void AUDIO_SD_readBytes(int bytes) {
	// no interruptions while things are happening
	// create a buffer of size remaining on the circular buffer
	uint8_t readData[bytes];
	uint32_t bytesRead;
	if (AUDIO_current_file == 0) {
		if (AUDIO_buffer_isEmpty()) {
			//HAL_TIM_Base_Stop_IT(&htim1);
			//HAL_TIM_PWM_Stop_IT(&htim1,TIM_CHANNEL_1);
		}
		return;
	}
	// fill the circular buffer with bytes, I guess
	// if the current file and previous file aren't the same, then close the current file and open the new one
	if (AUDIO_current_file != AUDIO_previous_file) {
		f_close(&AUDIO_SD_file);
		AUDIO_file_index = 0;
		AUDIO_previous_file = AUDIO_current_file;
		/* todo: make this open other files besides 1.bb8 */
		volatile FRESULT openResult = f_open(&AUDIO_SD_file, "1.bb8", FA_OPEN_ALWAYS | FA_READ);
		if(openResult != FR_OK)
		{
		  /* 'STM32.TXT' file Open for write Error */
		  HAL_GPIO_WritePin(LD2_GPIO_Port, LD2_Pin, GPIO_PIN_RESET);
		  return;
		}
	}
	volatile FRESULT readResult = f_read(&AUDIO_SD_file, readData, sizeof(readData), &bytesRead);
	if(readResult != FR_OK) {
	  /* 'STM32.TXT' file Open for write Error */
	  HAL_GPIO_WritePin(LD2_GPIO_Port, LD2_Pin, GPIO_PIN_RESET);
	  return;
	}
	for (int i=0; i<bytesRead; i++) {
		AUDIO_buffer_push(readData[i]);
	}
	if (bytesRead < bytes || f_eof(&AUDIO_SD_file)) {
			AUDIO_current_file = 0;
			AUDIO_previous_file = 0;
	}
	//HAL_TIM_Base_Start_IT(&htim1);
	//HAL_TIM_PWM_Start_IT(&htim1,TIM_CHANNEL_1);
	return;
}

